    public function getSourceContext()
    {
        return new Source("<head>
    <title>Connexion</title>
</head>

{% block stylesheets %}
    <link rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css\">
    <link rel=\"stylesheet\" href=\"{{ asset('css/styleRegistration.css') }}\">
{% endblock stylesheets %}

{% block body %}

<form method=\"post\">
    {% if error %}
        <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
    {% endif %}

    {% if app.user %}
        <div class=\"mb-3\">
            You are logged in as {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
        </div>
    {% endif %}

    <header class=\"container-fluid bg-light p-5\">
        <div class=\"row\">
            <div class=\"col-12 text-center\">
                <h1>Connexion</h1>
            </div>
        </div>
    </header>

     
    <div class=\"ml-3 mt-5\">
        <label for=\"inputEmail\">Email</label>
        <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control col-10 mb-3\" required autofocus>
    </div> 

    <div class=\"ml-3\">
        <label for=\"inputPassword\">Mot de passe</label>
        <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control col-10 mb-3\" required>
    </div>
    
    <input type=\"hidden\" name=\"_csrf_token\"
           value=\"{{ csrf_token('authenticate') }}\">

    

    {#
        Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
        See https://symfony.com/doc/current/security/remember_me.html

        <div class=\"checkbox mb-3\">
            <label>
                <input type=\"checkbox\" name=\"_remember_me\"> Remember me
            </label>
        </div>
    #}

    <button class=\"btn btn-lg btn-primary ml-3\" type=\"submit\">
        Connexion
    </button>
</form>
{% endblock %}
", "security/login.html.twig", "C:\\wamp64\\www\\Symfony\\immobilier2\\templates\\security\\login.html.twig");
